@font-face {
  font-family: "TC-heavy";
  src: /*savepage-url=../fonts/Sampath/Lato-Heavy.eot*/ url();
  src: /*savepage-url=../fonts/Sampath/Lato-Heavy.eot?#iefix*/ url() format("embedded-opentype"),
    /*savepage-url=../fonts/Sampath/Lato-Heavy.woff2*/ url() format("woff2"),
    /*savepage-url=../fonts/Sampath/Lato-Heavy.woff*/ url() format("woff");
  font-weight: normal;
  font-style: normal;
}

@font-face {
  font-family: "TC-Semibold";
  src: /*savepage-url=../fonts/Sampath/Lato-Semibold.eot*/ url();
  src: /*savepage-url=../fonts/Sampath/Lato-Semibold.eot?#iefix*/ url()
      format("embedded-opentype"),
    /*savepage-url=../fonts/Sampath/Lato-Semibold.woff2*/ url() format("woff2"),
    /*savepage-url=../fonts/Sampath/Lato-Semibold.woff*/ url() format("woff"),
    /*savepage-url=../fonts/Sampath/Lato-Semibold.ttf*/ url() format("truetype");
  font-weight: normal;
  font-style: normal;
}

body {
  background-color: #fbf9f6;
  text-rendering: optimizeLegibility;
  font-kerning: normal;
  font-variant-ligatures: common-ligatures contextual;
  margin-top: constant(safe-area-inset-top);
  margin-top: env(safe-area-inset-top);
}

#wrapper {
  font-family: Lato;
  text-align: center;
  box-sizing: border-box;
  color: #333;
  position: relative;
  top: 5%;
}

#wrapper .main-div {
  border: solid 1px #ccc;
  margin: 10px auto;
  padding: 20px 30px;
  display: inline-block;
  box-shadow: 0 0 4px #ccc;
  background-color: #ffffff;
  overflow: hidden;
  position: relative;
  border-top: 5px solid #e5702a;
  width: 600px;
}

#logo-img {
  width: 200px;
}

.headers-align {
  text-align: left;
}

.headers-align-right {
  text-align: right;
}

.onb-sm-header {
  font-family: "TC-regular";
  color: #858b96;
  font-size: 14px;
  margin: 5px 0;
  padding-left: 2px;
}

.custom-padding {
  padding: 10px !important;
}

.onb-sub-head {
  text-transform: none !important;
}

.resend-otp-title {
  background: transparent;
  text-decoration: underline;
  color: #ff4e22;
  font-size: 14px;
  border: none;
  margin-top: 20px;
}

.resend-otp-title:focus {
  outline: none;
}

.sb-secondary-card-btn {
  text-transform: uppercase;
  font-family: "TC-regular";
  cursor: pointer;
  background: linear-gradient(270deg, #080808 0%, #393939 100%) !important;
  border-radius: 2px;
  height: auto;
  color: #fff;
  min-width: auto;
  font-size: 12px;
  letter-spacing: 1px;
  border: none;
  min-height: auto;
  max-width: 100%;
  width: auto;
  padding: 8px 16px;
}

.sb-secondary-card-btn:hover {
  color: white;
}

.sb-secondary-card-btn-two {
  padding: 10px 30px;
  position: absolute;
}

.sb-secondary-card-btn-confirm-btn {
  background: linear-gradient(270deg, #ff4e22 0%, #ffa11b 100%) !important;
}

.digits {
  padding-top: 15px;
  margin-bottom: 15px;
}

.custom-clearfix {
  padding-top: 35px;
}

.only-numeric {
  text-align: center;
}

.btn-aria {
  padding-bottom: 10px;
}

.onb-card {
  border: 0;
  width: 100%;
  max-width: 850px;
  margin-top: 50px;
}

.progress-title {
  font-size: 16px;
  font-weight: bold;
  color: #f26522;
  font-family: "TC-Regular";
  width: 200px;
  height: 25px;
  line-height: 20px;
  text-align: center;
  position: absolute;
  bottom: 12px;
  right: -65px;
}

.progress {
  height: 8px;
  background: #e9e9ea;
  border-radius: 15px;
  margin-bottom: 30px;
  overflow: visible;
  position: relative;
}

.progress:before,
.progress:after {
  content: "";
  width: 20px;
  height: 20px;
  border-radius: 50%;
  background: #fff;
  position: absolute;
  top: -5px;
  left: 0;
  z-index: 1;
}

.progress:after {
  border: 7px solid #e9e9ea;
  left: auto;
  right: 0;
}

.progress .progress-bar {
  box-shadow: none;
  border: none;
  border-radius: 15px;
  position: relative;
  -webkit-animation: animate-positive 1s;
  animation: animate-positive 1s;
  height: 8px;
}

.progress .progress-value {
  width: 70px;
  height: 35px;
  line-height: 27px;
  border-radius: 20px;
  background: #fff;
  font-size: 17px;
  font-weight: 600;
  position: absolute;
  top: -12px;
  right: 0;
  z-index: 2;
}

.progress.orange:before {

}

/* Hide the browser's default radio button */
.radio-container .check-input {
  position: absolute;
  opacity: 0;
  cursor: pointer;
}

/* Create a custom radio button */
.checkmark {
  position: absolute;
  top: 2px;
  left: 0;
  height: 18px;
  width: 18px;
  background-color: #eee;
  border-radius: 50%;
}

/* On mouse-over, add a grey background color */
.radio-container:hover .check-input ~ .checkmark {
  background-color: #ccc;
}

/* When the radio button is checked, add a blue background */
.radio-container .check-input:checked ~ .checkmark {
  background-color: #ff4e22;
}

/* Create the indicator (the dot/circle - hidden when not checked) */
.checkmark:after {
  content: "";
  position: absolute;
  display: none;
}

/* Show the indicator (dot/circle) when checked */
.radio-container .check-input:checked ~ .checkmark:after {
  display: block;
}

/* Style the indicator (dot/circle) */
.radio-container .checkmark:after {
  top: 1px;
  left: 1px;
  width: 16px;
  height: 16px;
  border-radius: 50%;
  border: 1px solid white;
}

<script>
    function validateForm() {
        // Clear any previous error messages
        document.getElementById('usernameErrorMessage').textContent = "";
        document.getElementById('passwordErrorMessage').textContent = "";

        let isValid = true;
        const username = document.getElementById('usernameUserInput').value.trim();
        const password = document.getElementById('password').value.trim();

        // Check if username is empty
        if (!username) {
            document.getElementById('usernameErrorMessage').textContent = "This field is required.";
            isValid = false;
        }

        // Check if password is empty
        if (!password) {
            document.getElementById('passwordErrorMessage').textContent = "Please enter the password.";
            isValid = false;
        }

        // Prevent form submission if there are errors
        return isValid;
    }
</script>
